            transform-origin: center;

            opacity: 0.8;
        }
        svg g[inkscape\:label=star] path {
            animation: star-color 30s ease-in-out infinite;
        }

            transform-origin: center;

        }
        svg g[inkscape\:label="ajna glow"] {

            }
            to {

            }

            }

            }

            }
